import React from 'react';
import Footer from '../components/Footer';
import Image from 'react-bootstrap/Image';
import Layout from '../components/Layout';

const ppic = {
    width: 200,
    height: 200
}

const Welcome = () => (
    <Layout>
        <div>
            <h1>Developer portfolio for Fayyaadh Naidoo</h1>
            <Image src='/static/images/Fayyaadh.jpg' roundedCircle style={ppic}></Image>
            <Footer></Footer>
        </div>
        </Layout>
)
export default Welcome;
